import React from "react";
import { Box, Heading, Grid, Button, Avatar } from "@chakra-ui/react";

const User = (props) => {
  const blocks = [1, 2, 3, 4, 5, 6, 7, 8, 9];
  return (
    <Box
      key={props}
      bg="gray.800"
      width="22em"
      height="100px"
      borderRadius="md"
    >
      <Avatar></Avatar>
      <Button></Button>
    </Box>
  );
};

export default User;
